# Define the global variables
formattedDt = datetime(2024, 1, 1, 0, 0)
interval_minutes = 1

# Define the schema
_SCHEMA = Schema(schema=lambda: {
    "zoneKey": random.randint(1, 10),
    "pk": (random.randint(1, 10) * 1000000000)+random.randint(0, 99999),
    "date": get_date(),
    "temperature" : random.randint(1, 10) * random.randint(1, 10),
    "pressure":random.randint(1, 500)+random.randint(1, 500)
}, iterations=50000)

# Define the get_date function
def get_date():
    global formattedDt
    formattedDt += timedelta(minutes=interval_minutes)
    return formattedDt.isoformat()

